SET DEFINE OFF;

À Semad, tem por competência, além de outras estabelecidas em atos regulamentares pelo Chefe do Executivo, conforme dispõe a Lei n° 590 de 13.3.2001:
a)	formulação, coordenação e controle dos sistemas de pessoal, suprimentos, patrimônio e serviço social;
b)	modernização administrativa;
c)	documentação e arquivo;
d)	transporte oficial;
e)	desenvolvimento de recursos humanos;
f)	coordenar a integração entre os órgãos da estrutura municipal,objetivando o alcance das metas estabelecidas pela Prefeitura de Manaus.
',null,null,null,null,null,null,null);

I.	praticar atos de designação dos titulares e substitutos de funções gratificadas e de substitutos  dos cargos comissionados vinculados a símbolos, quando a substituição não exceder a trinta dias, mediante indicação dos Secretários Municipais;
II.	formalizar portarias de gratificações de Tempo Integral, Especialização, Mestrado e Doutorado, que serão concedidas mediante solicitação do Secretário da Pasta em que o servidor se encontre lotado;
III.	Controlar o deslocamento dos servidores para fora do Município, mediante autorização do Chefe do Executivo, objetivando a concessão de passagens e diárias e o oferecimento de relatório;
IV.	aprovar normas gerais, orientar e supervisionar a elaboração da programação dos órgãos e entidades públicas, relativamente às áreas-meio compreendidas nos Sistemas Municipais sob sua responsabilidade;
V.	orientar e supervisionar a elaboração de estudos especiais destinados à racionalização das Atividades-Meio, com o fim de reduzir seus custos e aumentar sua eficiência;
VI.	autorizar a abertura de concursos públicos, homologação dos resultados e prorrogar o prazo de sua validade;
VII.	celebrar os contratos de locação de imóveis para utilização dos órgãos do Município;                                   
VIII.	assinar a emissão de certificados de registro ou certidões para fins de licitação;
IX.	aprovar a programação para treinamento sistemático dos recursos humanos do Município;   
X.	analisar as propostas de lotação ideal, o cronograma de seu preenchimento e efetivar o remanejamento de pessoal;
